import React, { Component } from 'react';

class WishMessage extends Component{

    constructor(){
        super();
        this.state ={
            message:'Good Morning'
        }
    }

  render(){
      return(
          <div>
             <h1>{this.state.message}</h1> 
          </div>
      );
  }
}

export default WishMessage;
